import React, { useState } from "react";
import styles from "../sass/Jumbo.scss";

const defaultPhoto =
  "https://business.google.com/photos/l/04832235835203117297";

export default function Jumbo() {
  [mainPhoto, setMainPhoto] = useState(defaultPhoto);
  return (
    <div className={styles.jumbotron}>
      <img
        className={styles.heroImage}
        src={defaultPhoto}
        alt="painting sample"
      />
    </div>
  );
}
